import React from 'react';

function Nav({ setCurrentPage, pages }) {
    return (
       <div className='d-flex justify-content-between'>
           <h1>John Nguyen</h1>
           <ul className='nav nav-tabs'>
               <li className='nav-item' onClick={ ()=> setCurrentPage(pages[0])}>About</li>
               <li className='nav-item' onClick={ ()=> setCurrentPage(pages[1])}>Contact</li>
               <li className='nav-item' onClick={ ()=> setCurrentPage(pages[2])}>Projects</li>
           </ul>
       </div>
    )
}

export default Nav;
